import { Link } from "react-router-dom";

function Navigation() {
  return (
    <nav>
      <div>
        <Link>Summary</Link>
      </div>
      <div>
        <Link>Identification</Link>
      </div>
      <div>
        <Link>Check Anomaly</Link>
      </div>
    </nav>
  );
}

export default Navigation;
